     gorilla_notes.main.main_BANG_(false, "{:options {:reverse-notes? false, :header? false, :notes-in-cards? false, :custom-header [:div [:big \"Notespace\"] [:hr]], :custom-footer [:div [:hr]]}, :ids [\"434\" \"499\" \"436\" \"437\" \"438\" \"1011\" \"941\" \"942\" \"943\" \"944\" \"1012\" \"1013\" \"1014\" \"948\" \"949\" \"950\" \"951\" \"952\" \"953\" \"954\" \"1017\" \"956\" \"957\" \"958\" \"1025\" \"960\" \"961\" \"962\" \"963\" \"964\" \"1022\" \"966\" \"967\" \"968\" \"969\" \"970\" \"971\" \"1019\" \"973\" \"974\" \"975\" \"976\" \"977\" \"978\" \"979\" \"980\" \"981\" \"982\" \"983\" \"984\" \"985\" \"986\" \"1020\" \"1021\" \"989\" \"990\" \"991\" \"992\" \"993\" \"994\" \"995\" \"996\" \"997\" \"998\"], :id->content {\"984\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"784\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"388\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"1015\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"977\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are expected to return a seq of strings. These strings are concatenated and renderdered as Markdown.\"]]], \"641\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"445\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"696\" [:div [:p/code {:code \"(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"739\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"735\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"780\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"499\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\"]]], \"733\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"728\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nLet us see how to do this with the Notespace API.\\n### The main API functions\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace!\\n\\nUse `notespace.api/eval-this-notespace!` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line!\\n\\nUse `notespace.api/eval-note-at-line!` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line! 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"392\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"965\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"945\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"1024\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"955\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(-0.20558845104447743\\n -0.40499699378760323\\n -0.23763434197362088\\n 0.22641076918038616\\n 0.24285264064421008\\n -0.06543265935846554\\n 0.0665202866721557\\n -0.3275772762436979\\n 0.042323095844715386)\\n\"}]]], \"765\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"867\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"1010\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"581\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"827\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"978\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"682\" [:div nil [:div [:p/markdown \"The `F` macro allows to define a Clojure future that informs Notespace when it realizes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"528\" [:div nil [:div [:p/markdown \"## Basic workflow -- the main API functions\\n\\nLet us present some of the Notespace API functions, that can help you to get along with notespaces.\\n### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### eval-this-notespace!\\n\\nUse `notespace.api/eval-this-notespace!` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n### eval-note-at-line!\\n\\nUse `notespace.api/eval-note-at-line!` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line! 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"582\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"831\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"458\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"429\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"704\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"665\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(0.47418623615843447\\n 0.42793767572849317\\n 0.04555840128100308\\n 0.1916646855077091\\n 0.3321369949659746\\n 0.6712430596573268\\n 0.20628102765295364\\n 0.49812663123892453\\n 0.3771918894598335)\\n\"}]]], \"381\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"422\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data [5, 10, 5, 20, 10] :limit 5 :svgWidth 100 :svgHeight 20 :margin 5}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"941\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"432\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"709\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"438\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"671\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"612\" [:div [:p/code {:code \"(def x\\n  (future\\n   (Thread/sleep 2000)\\n   (->> #(- (rand) 0.5)\\n        (repeatedly 999)\\n        (reductions +))))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/x\\n\"}]]], \"402\" [:div [:p/code {:code \"(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"450\" [:div nil [:div [:p/markdown \"The `F` macro allows to define a Clojure future that informs Notespace when it realizes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"545\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"695\" [:div nil [:div [:p/markdown \"If when rendering this notespace the user evaluated the code in the comment below, t  to bring the usual REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference. If `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. Otherwise, you should see a mark that says that it is still pending.\\n\\nFor example:\"]]], \"958\" [:div nil [:div [:p/markdown \"The `D` macro allows to define a Clojure delay that informs Notespace when it is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"689\" [:div nil [:div [:p/markdown \"If when rendering this notespace the user called `notespace.api/eval-and-realize-note-at-line!` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says that it is still pending.\"]]], \"395\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"811\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"480\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"996\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"737\" [:div nil [:div [:p/sparklinespot {:data (-0.26351599795508995 -0.5284780980626176 -0.7955086332003455 -1.061748337374581 -0.8982086159254105 -0.5588617198277458 -0.9988408771292681 -0.8345639793144296 -1.2686872695116755), :svgHeight 20}]]], \"630\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"663\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"607\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"736\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((2 3 2 5 3 2)\\n (4 4 4 5 4 4)\\n (4 4 5 0 1 0)\\n (2 2 2 2 0 4)\\n (0 0 5 5 5 5)\\n (5 4 3 1 5 0))\\n\"}]]], \"927\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"472\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div nil]], \"644\" [:div nil [:div [:p/sparklinespot {:data (-0.23172723860144995 -0.7278949758617794 -1.0218078630933087 -1.465258981126527 -1.638737500714897 -1.6908301782281279 -1.5326826582925004 -1.8156432498520827 -1.7292479379433758), :svgHeight 20}]]], \"556\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"884\" [:div nil [:div [:big [:big 3]]]], \"943\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/p1\\n\"}]]], \"957\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"949\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line!\\n\\nUse `notespace.api/eval-and-realize-note-at-line!` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line! 14)` applies that to the note at line 14.\"]]], \"485\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data [5, 10, 5, 20, 10] :limit 5 :svgWidth 100 :svgHeight 20 :margin 5}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data [5 10 5 20 10], :limit 5, :svgWidth 100, :svgHeight 20, :margin 5}]]]], \"1016\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"389\" [:div [:p/code {:code \"(def x\\n  (future\\n   (Thread/sleep 2000)\\n   (->> #(- (rand) 0.5)\\n        (r ome reason.\\n### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"871\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` actually render by an extended version of Hiccup. It supports where [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"588\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"561\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"587\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"426\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"492\" [:div nil [:div [:p/markdown \"Most notes are assigned the default kind `:naive` automatically.\"]]], \"443\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/p2\\n\"}]]], \"818\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"985\" [:div nil [:div [:big [:big 3]]]], \"387\" [:div [:p/code {:code \"(require '[notespace.api :refer [F]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"585\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"603\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"953\" [:div [:p/code {:code \"(def x\\n  (future\\n   (Thread/sleep 2000)\\n   (->> #(- (rand) 0.5)\\n        (repeatedly 999)\\n        (reductions +))))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/x\\n\"}]]], \"632\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"661\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"  -0.07927372326855453\\n -0.3892033018908122\\n -0.1840452891454467\\n -0.5253857202091219\\n -0.3197685148404996\\n -0.4124568768569429\\n 0.08679487877652603)\\n\"}]]], \"512\" [:div nil [:div [:p/markdown \"## Basic workflow -- the main API functions\\n\\nLet us present some of the Notespace API functions, that can help you to get along with notespaces.\\n### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instear of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### eval-this-notespace!\\n\\nUse `notespace.api/eval-this-notespace!` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n### eval-note-at-line!\\n\\nUse `notespace.api/eval-note-at-line!` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line! 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"449\" [:div [:p/code {:code \"(require '[notespace.api :refer [F]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"727\" [:div nil [:div [:p/markdown \"Coming soon.\"]]], \"594\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"777\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"740\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"903\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 9)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.08111875688085735 0.5648277319625428 0.2610988836754502 -0.12311658856168173 -0.4457138667329916 -0.4429666785530011 -0.6388722952977209 -0.8818741434599927 -0.7003937536266317), :svgHeight 20}]]]], \"1018\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"814\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"553\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* 1699635214768 -0.8883048831856197 0.45999333170163625 1.024788150541994 -0.45404352062601205 -0.6459960798453261 0.8525814549862926 0.5629232444950938 -0.8574089681818382), :limit 100, :svgWidth 100, :svgHeight 20}]]]]], \"844\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"999\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0&feature=youtu.be) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n\\nLet us see how to do this with the Notespace API.\\n### The main API functions\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace!\\n\\nUse `notespace.api/eval-this-notespace!` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line!\\n\\nUse `notespace.api/eval-note-at-line!` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line! 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"496\" [:div nil [:div [:p/markdown \"Coming soon.\"]]], \"721\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds.\\n\\nAnother way is to assign a kind to a note is to include it in a vector beginning with a keyword. This is compatible with the approach of [Oz](https://github.com/metasoarous/oz).\"]]], \"455\" [:div nil [:div [:p/markdown \"The `D` macro allows to define a Clojure delay that informs Notespace when it realizes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"1011\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n\\nLet us see how to do this with the Notespace API.\\n### The main API functions\\n## gHeight 20}]]], \"526\" [:div nil [:div [:p/markdown \"## Basic workflow -- the main API functions\\n\\nLet us present some of the Notespace API functions, that can help you to get along with notespaces.\\n### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### eval-this-notespace!\\n\\nUse `notespace.api/eval-this-notespace!` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n### eval-note-at-line!\\n\\nUse `notespace.api/eval-note-at-line!` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line! 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"734\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(0.164362163098016\\n 0.6400261084286253\\n 0.7217477252751788\\n 1.017964157618242\\n 1.2774672819006494\\n 1.148787096325139\\n 1.271268880485148\\n 1.5315708299233286\\n 1.0782571131165781)\\n\"}]]], \"617\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"409\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"676\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"444\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"855\" [:div nil [:div [:p/markdown \"The `F` macro allows to define a Clojure future that informs Notespace when it is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"801\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"808\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((2 0 4 2 0 3)\\n (0 2 5 2 2 4)\\n (2 1 0 1 2 5)\\n (0 0 0 4 0 1)\\n (4 2 1 3 1 0)\\n (1 2 2 0 4 4))\\n\"}]]], \"406\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"595\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"555\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"563\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"986\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"804\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"967\" [:div [:p/code {:code \"(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"533\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"755\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"909\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"841\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"614\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"731\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"646\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data [5, 10, 5, 20, 10] :limit 5 :svgWidth 100 :svgHeight 20 :margin 5}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data [5 10 5 20 10], :limit 5, :svgWidth 100, :svgHeight 20, :margin 5}]]]], \"845\" [:div nil [:div [:p/markdown \"If you called `notespace.api/eval-and-realize-note-at-line!` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says that it is still pending.\"]]], \"723\" [:div nil [:div [:p/markdown \"Most notes are assigned the default kind `:naive` automatically.\"]]], \"906\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 9)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.3737830811097185 0.4797315927410418 0.36219860680487836 -0.06703052134209586 -0.1848898832128094 -0.4524414055167635 -0.6044560752234843 -0.935752628677256 -0.7887535956049182), :svgHeight 20}]]]], \"853\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"792\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"847\" [:div nil [:div [:p/markdown \"If you called `notespace.api/eval-and-realize-note-at-line!` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says that it is still pending.\"]]], \"774\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"838\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"917\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"947\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"971\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"500\" [:div nil [:div [:p/markdown \"## Basic workflow -- the main API functions\\n\\nLet us present some of the Notespace API functions, that can help you to get along with notespaces.\\n### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, it is an alternative to `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n### eval-this-notespace!\\n\\nUse `notespace.api/eval-this-notespace!` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n### eval-note-at-line!\\n\\nUse `notespace.api/eval-note-at-line!` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line! 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n### render-static-html!\\n\\nUse `notespace.api/render-static-html!` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"460\" [:div nil [:div [:p/markdown \"The `A` function allows to define a Clojure atom that informs Notespace when it realizes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"756\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"937\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"775\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"778\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"849\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"611\" [:div nil [:div [:p/markdown \"The `F` macro allows to define a Clojure future that informs Notespace when it realizes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"803\" [:div [:p/code {:code \"(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"994\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"806\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"795\" [:div nil [:div [:p/markdown \"If when rendering this notespace the user called `notespace.api/eval-and-realize-note-at-line!` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says that it is still pending.\"]]], \"963\" [:div nil [:div [:p/markdown \"The `A` function allows to define a Clojure atom that informs Notespace when it changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"453\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"746\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"529\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). When the Notespace project stabilizes, we will probably provide similar solutions for other editors too.\"]]], \"690\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"457\" [:div nil [:div [:p/markdown \"If when rendering this notespace the user called `notespace.api/eval-and-realize-note-at-line!` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says that it is still pending.\"]]], \"424\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"427\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"946\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"848\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"495\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\"]]], \"622\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(0.3182811674485384\\n 0.00372112555114279\\n -0.23725512202572496\\n 0.18587115794716136\\n 0.6331997841953368\\n 0.7668063754735427\\n 0.829830943585347\\n 0.8720097551999584\\n 1.2538101240837398)\\n\"}]]], \"866\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 4}\\n\"}]]], \"412\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"491\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"615\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"708\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))) :div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"786\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"713\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"897\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"771\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"407\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"922\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"1006\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"494\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"762\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"378\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"900\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 9)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.4310740229689919 0.14706150256242678 0.5627368663306035 0.7930022424038911 0.3289514829872202 0.2009498525402611 0.35441254569155134 0.2776553314046577 0.3534080770106416), :svgHeight 20}]]]], \"951\" [:div [:p/code {:code \"(r
